import React from 'react';

const Miles = props => {
    render()
    return  (
        <div className="input-container">
            <input 
                type="text" 
                placeholder="Must be a number"
                value={props.miles} 
                onChange={props.handleChange}
                name="miles" 
                className="offer-input" 
                />
        </div>
    )
}

export default Miles
